export declare const dict: (o: {
    [key: string]: any;
}) => {
    /**
     * @param secondary contains fallback values for `undefined`
     * @returns a fallback of both objects
     */
    fallback: (secondary: {
        [key: string]: any;
    }) => {
        [key: string]: any;
    };
    /**
     * @param secondary contains fallback values for `undefined`
     * @returns an intersection of both objects
     */
    intersect: (secondary: {
        [key: string]: any;
    }) => {
        [key: string]: any;
    };
};
